import React from "react";

const Question = (props) => {
  return (
    <div>
      {/* <h1>{props.questionName}</h1>
      <p>{props.questionBody}</p> */}

      <h1>{props.questions[props.firstQuestionIndex].questionName}</h1>
      <p>{props.questions[props.firstQuestionIndex].questionBody}</p>
    </div>
  );
};

export default Question;
